import React from "react";
import "./search-box.styles.css";

const SearchBox = (props) => {
  return (
    <div>

      <input
        className={`search-box ${props.className}`}
        type="search"
        placeholder={props.placeholder}
        onChange={props.onChangeHandler}
      />
    </div>

  );

}

export default SearchBox;
